const initialState = {
    users:[]
}

const AdminUserReducer = (preState=initialState, action) => {
    switch (action.type) {
        case "FIND_ALL_USERS":
            return  {...preState,
                users : action.users}
        case "DELETE_USER":
            return ({...preState,
                users: preState.users.filter(
                    user => user._id === action.userIdToDelete? false : true)})
    }
}

export default AdminUserReducer
